app.get('/company', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify(companies));
});

app.get('/company/:companyId', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify(companiesDetail.companies.find(a => a.id === parseInt(req.params.companyId))));
});

app.get('/entity/:companyId', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify({ entities: entities.entities.filter(a => a.companyId === parseInt(req.params.companyId))}));
});

app.get('/subentity/:entityId', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify({ subentities: subentities.subentities.filter(a => a.entityId === parseInt(req.params.entityId))}));
});

app.get('/subentity/:entityId/:subentityId', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify({ subentity: subentitiesDetail.subentities.find(a => a.id === parseInt(req.params.subentityId) && a.entityId === parseInt(req.params.entityId))}));
});

app.get('/country', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.send(JSON.stringify(countries));
});

